import React from 'react'

export default function Card(props){
    let badgeText
    if (props.obj.open_spots === 0) {
        badgeText = "SOLD OUT"
    }  else if(props.obj.open_spots>0){
        badgeText="AVAILABLE"
    }


    const cover_imgUrl = props.obj.cover_img.replace(/"/g, '');
    console.log('Cover Image URL:', cover_imgUrl);


return(
    <div className="card">
        <img src= {cover_imgUrl} alt='' className="card-photo"/>
        { badgeText &&<button className="btn">{badgeText}</button> }
        <p className="star-items"> 
            <img src="./Star.png" alt="" className="star-photo"/>   
            . {props.obj.location}
        </p>
        <p>{props.obj.title}</p>
        <p><b>From ${props.obj.price}</b>/per person</p>
    </div>
    );
}

